import EventsFrom from "./mini_components/EventsForm";
import MarksFrom from "./mini_components/MarksForm";
import ScheduleForm from "./mini_components/ScheduleForm";
import classes from "./styles.module.css"

const Home = () =>
{
    return (
        <div>
            <h1>Домашняя страница</h1>
            <div className={classes.overplay}><EventsFrom classes={classes}/></div>
            <div className={classes.overplay}><MarksFrom classes={classes}/></div>
            <div className={classes.overplay}><ScheduleForm classes={classes}/></div>
        </div>
    )
}

export default Home;
